class Solution(object):
    def incremovableSubarrayCount(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        n = len(nums)
        left_strict = [0] * n
        right_strict = [0] * n

        for i in range(1, n):
            if nums[i-1] < nums[i]:
                left_strict[i] = left_strict[i-1] + 1
            else:
                left_strict[i] = 0

        for i in range(n-2, -1, -1):
            if nums[i] < nums[i+1]:
                right_strict[i] = right_strict[i+1] + 1
            else:
                right_strict[i] = 0

        total = 0
        for i in range(n):
            total += (left_strict[i] + 1) * (right_strict[i] + 1) - 1

        return total
